import React, { Component } from 'react';
import Customer from './components/Customer'
import './App.css';
import Table from '@material-ui/core/Table';
import TableHead from '@material -ui/core/TableHead';


const customers = [
  {
  'id':1,
  'image':'https://placeimg.com/64/64/1',
  'name':'이창택',
  'birthday':'941014',
  'gender':'남자',
  'job':'대학생'
  },
  {
  'id':2,
  'image':'https://placeimg.com/64/64/2',
  'name':'홍길동',
  'birthday':'960306',
  'gender':'여자',
  'job':'프로그래머'
  },
  {
    'id':3,
    'image':'https://placeimg.com/64/64/3',
    'name':'이순신',
    'birthday':'123456',
    'gender':'남자',
    'job':'장군'
  }
]


class App extends Component {
  render(){
    return (
      <div>
        {
          customers.map(c => {
            return (
              <Customer
                key={c.id}
                id={c.id}
                image={c.image}
                name={c.name}
                birthday={c.birthday}
                gender={c.gender}
                job={c.job}
              />
            )
          })
        }
      </div>
    );
  }

}

export default App;
